import {BrowserRouter} from 'react-router-dom'
import AppRouter from './components/AppRouter';
import Navbar from './components/NavBar/NavBar';
import './App.css';
function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <AppRouter />
    </BrowserRouter>
  );
}

export default App;
